#include <iostream>#include <vector>#include <algorithm>int main(){    int n;    std::cin >> n;    std::vector<int> a(n);    for(int i = 0; i < n; ++i){        std::cin >> a.at(i);    }    int A;    std::cin >> A;    std::vector< std::vector<bool> > dp(n + 1, std::vector<int> (A + 1, 0));    dp.at(0).at(0) = true;    for(int i = 0; i < n; ++i){        for(int j = 0; j <= A; ++j){            dp.at(i + 1).at(j) = dp.at(i).at(j);            if(j >= a.at(i)){                dp.at(i + 1).at(j) |= dp.at(i).at(j - a.at(i));            }        }    }    if(dp.at(n).at(A)){        std::cout << "YES" << std::endl;    }else{        std::cout << "NO" << std::endl;    }    return 0;}